package org.apache.commons.text;

import org.apache.commons.text.RandomStringGenerator;
import org.apache.commons.text.CharacterPredicate;
import org.junit.jupiter.api.Test;
import static org.assertj.core.api.Assertions.assertThat;

public class RandomStringGeneratorTest1 {

    @Test
    public void testFilteringRuleReplacement() {
        // Step 0: Establish a generator configuration with initial filtering rule for lowercase letters between 'a' and 'z'
        RandomStringGenerator.Builder initialConfig = RandomStringGenerator.builder();

        // Step 1: Apply initial filtering rule to restrict output to lowercase letters between 'a' and 'z'
        CharacterPredicate lowercaseLettersPredicate = CharacterPredicates.forAsciiRange('a', 'z');
        RandomStringGenerator.Builder filteredConfig = initialConfig.filteredBy(lowercaseLettersPredicate);

        // Step 2: Replace filtering rule with alternative criterion permitting only the character 'b'
        CharacterPredicate onlyBPredicate = CharacterPredicates.forChar('b');
        RandomStringGenerator.Builder updatedConfig = filteredConfig.filteredBy(onlyBPredicate);

        // Step 3: Finalize the configuration
        RandomStringGenerator finalizedConfig = updatedConfig.build();

        // Step 4: Generate a text sequence of one hundred characters
        String generatedText = finalizedConfig.generate(100);

        // Step 5: Examine each character in the generated text
        // Step 6: Confirm every character matches the expected value of 'b'
        assertThat(generatedText).containsOnly('b');
    }
}

