                return new RandomStringGenerator();
            }
        }

        public String generate(int length) {
            return new String(new char[length]).replace('\0', 'b');
        }
    }

    // Declare static character predicate constants
    private static final CharacterPredicate predicate_a = new CharacterPredicate() {
        @Override
        public boolean test(char c) {
