        builder.withinRange(new char[][]{{'a', 'z'}});

        // Step 4: Apply the first character predicate filter (predicate_a)
        builder.filteredBy(new CharacterPredicate[]{predicate_a});

        // Step 5: Replace the filter with the second predicate (predicate_b)
