    public void testGenerateSecurePasswordSequence() {
        // Step 0: Configure the text generator
        RandomStringGenerator.Builder builder = new RandomStringGenerator.Builder();
        RandomStringGenerator configuredGenerator = builder.usingRandom(null).get();

        // Step 1: Generate a ten-character sequence
        String generatedSequence = configuredGenerator.generate(10);

        // Step 2: Verify every character in the generated sequence
        for (int i = 0; i < generatedSequence.length(); i++) {
            char c = generatedSequence.charAt(i);
            boolean isLetter = Character.isLetter(c);
            boolean isDigit = Character.isDigit(c);
            boolean isPunctuation = !Character.isLetterOrDigit(c) && !Character.isWhitespace(c);
            boolean isValid = isLetter || isDigit || isPunctuation;
            assertTrue(isValid, "Character '" + c + "' at position " + i + " is not in an approved category.");
        }
    }
}

package org.apache.commons.text;

import org.junit.jupiter.api.Test;
import java.util.Arrays;

import static org.junit.jupiter.api.Assertions.assertTrue;

public class RandomStringGeneratorTest1 {

    @Test
    public void testRandomStringGeneratorWithCustomConstraints() {
        // Step 0: Construct a sorted character array containing specific punctuation symbols
        char[] punctuation_array = {'!', '@', '#'};
        Arrays.sort(punctuation_array);

        // Step 1: Enable accumulation mode in the Random String Generator builder
        RandomStringGenerator.Builder builder_with_accumulation = RandomStringGenerator.builder().setAccumulate(true);

        // Step 2: Add three alphanumeric ranges (lowercase letters, uppercase letters, digits) to the builder
        RandomStringGenerator.Builder builder_with_ranges = builder_with_accumulation
            .withinRange(97, 122)  // lowercase letters (a-z)
            .withinRange(65, 90)   // uppercase letters (A-Z)
            .withinRange(48, 57);  // digits (0-9)

        // Step 3: Add the punctuation array as an additional character source to the builder
        RandomStringGenerator.Builder configured_builder = builder_with_ranges.selectFrom(punctuation_array);

        // Step 4: Generate a random string of fixed length using the configured generator
        RandomStringGenerator generator = configured_builder.build();
        String generated_string = generator.generate(10);

        // Step 5: Iterate through each character in the generated string
        for (int i = 0; i < generated_string.length(); i++) {
            char current_char = generated_string.charAt(i);

            // Step 6: Validate that every character satisfies at least one configured constraint
            boolean isLetter = Character.isLetter(current_char);
            boolean isDigit = Character.isDigit(current_char);
            boolean isPunctuation = Arrays.binarySearch(punctuation_array, current_char) >= 0;

            assertTrue(isLetter || isDigit || isPunctuation, 
                "Character '" + current_char + "' does not satisfy any configured constraint.");
        }
    }
}

