public class RandomStringGeneratorTest {
    @Test
    public void testRandomStringGenerationWithPunctuation() {
        // Step 0: Initialize a char array with punctuation characters in a specific order
        char[] punctuation = new char[]{'!', '"', '#', '$', '&', '\'', '(', ')', ',', '.', ':', ';', '?', '@', '[', '\\', ']', '^', '_', '`', '{', '|', '}', '~'};

