package org.apache.commons.text;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.Assertions;

import java.util.HashSet;
import java.util.Set;

public class RandomStringGeneratorTest1 {

    @Test
    public void testAccumulationMode() {
        // Step 0: Define reference character set with five specific characters
        char[] reference_set = {'a', 'b', 'c', 'd', 'e'};

        // Step 1: Initialize text generator with reference character set
        RandomStringGenerator.Builder builder = RandomStringGenerator.builder();
        builder.selectFrom(reference_set);

        // Step 2-5: Configure generator with subsets of characters
        char[] subset_of_four_chars = {'a', 'b', 'c', 'd'};
        char[] subset_of_three_chars = {'a', 'b', 'c'};
        char[] subset_of_two_chars = {'a', 'b'};
        char[] empty_char_array = {};

        builder.selectFrom(subset_of_four_chars);
        builder.selectFrom(subset_of_three_chars);
        builder.selectFrom(subset_of_two_chars);
        builder.selectFrom(empty_char_array);

        // Step 6: Enable accumulation mode
        builder.setAccumulate(true);

        // Step 7: Generate random text of ten characters
        RandomStringGenerator generator = builder.build();
        String generated_text_accumulation = generator.generate(10);

        // Step 8: Verify every character in generated text is within original reference set
        Set<Character> referenceSet = new HashSet<>();
        for (char c : reference_set) {
            referenceSet.add(c);
        }

        for (char c : generated_text_accumulation.toCharArray()) {
            Assertions.assertTrue(referenceSet.contains(c), 
                "Character '" + c + "' is not in the reference set when accumulation is enabled.");
        }
    }

    @Test
    public void testNonAccumulationMode() {
        // Step 0: Define reference character set with five specific characters
        char[] reference_set = {'a', 'b', 'c', 'd', 'e'};

        // Step 1: Initialize text generator with reference character set
        RandomStringGenerator.Builder builder = RandomStringGenerator.builder();
        builder.selectFrom(reference_set);

        // Step 9-12: Configure generator with subsets of characters
        char[] subset_of_four_chars = {'a', 'b', 'c', 'd'};
        char[] subset_of_three_chars = {'a', 'b', 'c'};
        char[] subset_of_two_chars = {'a', 'b'};
        char[] empty_char_array = {};

        builder.selectFrom(subset_of_four_chars);
        builder.selectFrom(subset_of_three_chars);
        builder.selectFrom(subset_of_two_chars);
        builder.selectFrom(empty_char_array);

        // Step 13: Disable accumulation mode
        builder.setAccumulate(false);

        // Step 14: Generate random text of ten characters
        RandomStringGenerator generator = builder.build();
        String generated_text_no_accumulation = generator.generate(10);

        // Step 15: Verify no character in generated text is from original reference set
        Set<Character> referenceSet = new HashSet<>();
        for (char c : reference_set) {
            referenceSet.add(c);
        }

        for (char c : generated_text_no_accumulation.toCharArray()) {
            Assertions.assertFalse(referenceSet.contains(c),
                "Character '" + c + "' is in the reference set when accumulation is disabled.");
        }
    }
}

