public class RandomStringGeneratorTest1 {

    @ParameterizedTest
    @ValueSource(booleans = { false, true })
    public void testRandomStringGeneration(boolean accumulate) {
        // Step 1: Assign String literal 'abcde' to variable str
        String str = "abcde";

        // Step 2: Obtain RandomStringGenerator builder instance
        RandomStringGenerator.Builder builder = RandomStringGenerator.builder();

        // Step 3: Chain .setAccumulate(accumulate) with boolean parameter
        builder.setAccumulate(accumulate);

        // Step 4: Chain .selectFrom('a', 'b', 'c', 'd', 'e') with five character arguments
        builder.selectFrom(new char[]{'a', 'b', 'c', 'd', 'e'});

        // Step 5: Chain .selectFrom('a', 'b', 'c', 'd') with four character arguments
        builder.selectFrom(new char[]{'a', 'b', 'c', 'd'});

        // Step 6: Chain .selectFrom('a', 'b', 'c') with three character arguments
        builder.selectFrom(new char[]{'a', 'b', 'c'});

        // Step 7: Chain .selectFrom('a', 'b') with two character arguments
        builder.selectFrom(new char[]{'a', 'b'});

        // Step 8: Chain .selectFrom(null) with null argument
        builder.selectFrom((char[]) null);

        // Step 9: Skip .selectFrom() with no arguments (no matching method)

        // Step 10: Chain .get() to build RandomStringGenerator and assign to variable generator
        RandomStringGenerator generator = builder.get();

        // Step 11: Invoke generator.generate(10) and assign returned String to variable randomText
        String randomText = generator.generate(10);

        // Step 12: Iterate over randomText.toCharArray() using enhanced for loop with loop variable c
        for (char c : randomText.toCharArray()) {
            // Step 13: Assert that accumulate equals (str.indexOf(c) != -1) for each character c
            assertEquals(accumulate, str.indexOf(c) != -1);
        }
    }
