        // Initialize a map field with key-value pairs where keys vary in length and values are numeric strings
        map_field = new HashMap<>();
        map_field.put("a", "1");
        map_field.put("bb", "22");
        map_field.put("ccc", "333");

        // Add semantic entries mapping 'animal' and 'target' to predefined constant values
        map_field.put("animal", "dog");
        map_field.put("target", "100");
    }

    @Test
    public void testCyclicSubstitutionDetection() {
        // Construct a local map containing a single entry where the key 'name' maps to a self-referential value using angle bracket delimiters
        Map<String, String> local_map = new HashMap<>();
        local_map.put("name", "<name>");

        // Invoke the static replace method on the String Substitutor component passing a template string containing a variable reference with the same name
        String template_string = "Hello <name>!";

        // Assert that the invocation throws an Illegal State Exception
        assertThrows(IllegalStateException.class, () -> {
            StringSubstitutor.replace(template_string, local_map, "<", ">");
        });
    }

    @AfterEach
    public void teardown() {
        // Nullify the map field to release resources
        map_field = null;
    }
