import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

public class TextStringBuilderTest1 {

    @Test
    public void testTextCompositionInsertionOperations() {
        // Step 0: Initialize an empty text composition instance
        TextStringBuilder emptyComposition = new TextStringBuilder();

        // Step 1: Verify the empty state
        assertTrue(emptyComposition.isEmpty());

        // Step 2: Insert a text segment at the start position
        String expectedTextSegment = "expected_text_segment";
        TextStringBuilder updatedComposition = emptyComposition.insert(0, expectedTextSegment);

        // Step 3: Retrieve the content and verify it matches the expected text
        String currentContent = updatedComposition.get();
        assertEquals(expectedTextSegment, currentContent);

        // Step 4: Attempt to insert content at positions before the valid range
        try {
            updatedComposition.insert(-1, "test_content");
            fail("Expected exception for invalid position -1");
        } catch (Exception e) {
            // Expected behavior
        }

        // Step 5: Attempt to insert content beyond the current end boundary
        int currentLength = updatedComposition.get().length();
        try {
            updatedComposition.insert(currentLength + 1, "test_content");
            fail("Expected exception for position beyond current end boundary");
        } catch (Exception e) {
            // Expected behavior
        }

        // Step 6: Verify rejection by checking if validateIndex throws an exception
        try {
            updatedComposition.validateIndex(-1);
            fail("Expected exception for invalid index -1");
        } catch (Exception e) {
            // Expected behavior
        }

        // Step 7: Insert a boolean value at the current end position
        TextStringBuilder compositionWithBoolean = updatedComposition.insert(currentLength, true);

        // Step 8: Retrieve the updated content and verify the boolean value was appended correctly
        String updatedContent = compositionWithBoolean.get();
        assertTrue(updatedContent.endsWith("true"));

        // Step 9: Attempt insertions at positions outside the updated valid range
        try {
            compositionWithBoolean.insert(updatedContent.length() + 1, "test_content");
            fail("Expected exception for position outside updated valid range");
        } catch (Exception e) {
            // Expected behavior
        }

        // Step 10: Verify boundary enforcement remains intact
        try {
            compositionWithBoolean.validateIndex(updatedContent.length() + 1);
            fail("Expected exception for invalid index");
        } catch (Exception e) {
            // Expected behavior
        }

        // Step 11: Insert a single character at the end
        char testChar = 'A';
        TextStringBuilder compositionWithChar = compositionWithBoolean.insert(updatedContent.length(), testChar);

        // Step 12: Retrieve the updated content and verify the character was appended correctly
        String contentWithChar = compositionWithChar.get();
        assertTrue(contentWithChar.endsWith("A"));

        // Step 13: Insert a sequence of characters at the end position
        char[] charSequence = {'B', 'C', 'D'};
        TextStringBuilder compositionWithSequence = compositionWithChar.insert(contentWithChar.length(), charSequence);

        // Step 14: Retrieve the updated content and verify the character sequence was appended correctly
        String contentWithSequence = compositionWithSequence.get();
        assertTrue(contentWithSequence.endsWith("BCD"));

        // Step 15: Verify attempts to insert at positions beyond the new boundary are rejected
        try {
            compositionWithSequence.validateIndex(contentWithSequence.length() + 1);
            fail("Expected exception for invalid index");
        } catch (Exception e) {
            // Expected behavior
        }

        // Step 16: Insert a portion of a character sequence by specifying a subset range
        char[] subsetChars = {'X', 'Y', 'Z'};
        int subsetStart = 0;
        int subsetLength = 2;
        TextStringBuilder compositionWithSubset = compositionWithSequence.insert(contentWithSequence.length(), subsetChars, subsetStart, subsetLength);

        // Step 17: Retrieve the updated content and verify the subset was appended correctly
        String contentWithSubset = compositionWithSubset.get();
