import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertTrue;

public class SeparatorConfigurationTest {

    // Mock class to represent separator configurations
    static class SeparatorConfig {
        private boolean[] separators;

        public SeparatorConfig() {
            // Default configuration: only space is a separator
            this.separators = new boolean[128]; // Covering ASCII range
            this.separators[' '] = true; // Space is a separator by default
        }

        public SeparatorConfig(char... customSeparators) {
            this.separators = new boolean[128];
            // Add custom separators
            for (char sep : customSeparators) {
                this.separators[sep] = true;
            }
        }

        public boolean isSeparator(char c) {
            return this.separators[c];
        }
    }

    @Test
    public void testSeparatorConfigurations() {
        // Setup: Initialize configurations
        SeparatorConfig defaultConfig = new SeparatorConfig();
        SeparatorConfig periodConfig = new SeparatorConfig('.');
        SeparatorConfig mixedConfig = new SeparatorConfig('.', '_', 'a');

        // Test 1: Default configuration
        SeparatorConfig activeConfig = defaultConfig;
        boolean periodCheckResult = activeConfig.isSeparator('.');
        boolean spaceCheckResult = activeConfig.isSeparator(' ');
        assertFalse(periodCheckResult, "Period should not be a separator in default configuration");
        assertTrue(spaceCheckResult, "Space should be a separator in default configuration");

        // Test 2: Custom configuration with only period
        activeConfig = periodConfig;
        spaceCheckResult = activeConfig.isSeparator(' ');
        periodCheckResult = activeConfig.isSeparator('.');
        assertFalse(spaceCheckResult, "Space should not be a separator with period-only configuration");
        assertTrue(periodCheckResult, "Period should be a separator with period-only configuration");

        // Test 3: Custom configuration with period, underscore, and letter 'a'
        activeConfig = mixedConfig;
        spaceCheckResult = activeConfig.isSeparator(' ');
        periodCheckResult = activeConfig.isSeparator('.');
        assertFalse(spaceCheckResult, "Space should not be a separator with mixed configuration");
        assertTrue(periodCheckResult, "Period should be a separator with mixed configuration");

        // Teardown: Clean up configurations (handled by garbage collection)
    }
}

