import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertEquals;

public class TextSimilarityTest {

    // Custom implementation of Levenshtein distance calculation
    private int calculateEditDistance(String s1, String s2) {
        int[][] dp = new int[s1.length() + 1][s2.length() + 1];

        for (int i = 0; i <= s1.length(); i++) {
            dp[i][0] = i;
        }

        for (int j = 0; j <= s2.length(); j++) {
            dp[0][j] = j;
        }

        for (int i = 1; i <= s1.length(); i++) {
            for (int j = 1; j <= s2.length(); j++) {
                if (s1.charAt(i - 1) == s2.charAt(j - 1)) {
                    dp[i][j] = dp[i - 1][j - 1];
                } else {
                    dp[i][j] = 1 + Math.min(Math.min(dp[i - 1][j], dp[i][j - 1]), dp[i - 1][j - 1]);
                }
            }
        }

        return dp[s1.length()][s2.length()];
    }

    @Test
    public void testTextSimilarityEditDistanceSymmetry() {
        // Step 0: Prepare two distinct text samples
        String text_sample_1 = "kitten";
        String text_sample_2 = "sitting";

        // Step 1: Calculate expected similarity score
        int expected_score = calculateEditDistance(text_sample_1, text_sample_2);

        // Step 2: Submit text_sample_1 and text_sample_2 to similarity calculation service
        int forward_distance = calculateEditDistance(text_sample_1, text_sample_2);

        // Step 3: Confirm forward_distance equals expected_score
        assertEquals(expected_score, forward_distance);

        // Step 4: Submit text_sample_2 and text_sample_1 to similarity calculation service
        int reverse_distance = calculateEditDistance(text_sample_2, text_sample_1);

        // Step 5: Confirm reverse_distance equals expected_score
        assertEquals(expected_score, reverse_distance);

        // Step 6: Verify forward_distance equals reverse_distance
        assertEquals(forward_distance, reverse_distance);
    }
}

