package org.apache.commons.text.translate;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.Assertions;
import java.io.Writer;
import java.io.IOException;

import static org.junit.jupiter.api.Assertions.assertInstanceOf;
import static org.junit.jupiter.api.Assertions.assertEquals;

public class CharacterSequenceTranslatorTest {
    private static int shared_counter = 0;

    @Test
    public void testTranslatorComposition() throws IOException {
        // Step 0: Initialize shared counter to zero (already done via class field)

        // Step 1: Create three translator instances that increment the shared counter on translate
        CharSequenceTranslator translator1 = new CounterIncrementingTranslator();
        CharSequenceTranslator translator2 = new CounterIncrementingTranslator();
        CharSequenceTranslator translator3 = new CounterIncrementingTranslator();

        // Step 2: Compose translator1 with translator2 and translator3 using the with method
        CharSequenceTranslator aggregated_translator = translator1.with(new CharSequenceTranslator[]{translator2, translator3});

        // Step 3: Invoke translate on the aggregated translator with empty string, zero index, and null writer
        aggregated_translator.translate("", 0, null);

        // Step 4: Verify the aggregated translator is an instance of Aggregate Translator
        assertInstanceOf(AggregateTranslator.class, aggregated_translator);

        // Step 5: Verify the shared counter equals three
        assertEquals(3, shared_counter);
    }

    // Custom translator that increments the shared counter
    private static class CounterIncrementingTranslator extends CharSequenceTranslator {
        @Override
        public int translate(CharSequence input, int index, Writer out) throws IOException {
            shared_counter++;
            return input.length();
        }
    }
}

