        OctalUnescaper octalUnescaper = new OctalUnescaper();
        StringWriter writer = new StringWriter();
        OctalUnescaper configuredSystem = octalUnescaper;

        // Step 1: Prepare content with an octal sequence followed by a high surrogate marker
        String scenarioOneContent = "\\141\\142\\143\\uD800";

        // Step 2: Submit the first scenario content to the transformation system
        String scenarioOneOutput = configuredSystem.translate(scenarioOneContent);

        // Step 3: Verify the system converts only the octal portion while maintaining the surrogate exactly as provided
        assertEquals("abc\\uD800", scenarioOneOutput);

        // Step 4: Prepare content mixing an octal sequence with a complete rocket emoji representation
        String scenarioTwoContent = "\\141\\142\\143\\uD83D\\uDE80";

        // Step 5: Process the mixed content through the transformation system
        String scenarioTwoOutput = configuredSystem.translate(scenarioTwoContent);

